window.bookSummaryJSON = "<p><b>It’s not easy being the wise magical tree in a world filled with demons and dangerous foes.</b></p> <p>Matt’s journey to survive in a world filled with heroes and demons continues! Matt now has to guide his growing nation through competing nations and kingdoms and demonic incursions, while trying to amass more power, train his forces, make more equipment, amass allies and friends, and navigate sensitive relationships with heroes and former heroes!</p> <p><b>Book two of an epic reincarnation/isekai LitRPG story about a man who becomes a tree, growing and progressing throughout the ages in an eternal conflict against a demon incursion.</b></p>"; 
